import React from 'react';

const Glossary = ({ glossary = [] }) => {
	return (
		<>
			{glossary.map((data, index) => {
				if (data) {
					return (
						<div key={data.term}>
							<h1>{data.term}</h1>
							<p>{data.definition}</p>
						</div>
					);
				}
				return null;
			})}
		</>
	);
};

export default Glossary;
